import AllUsers from "../components/pages/AllUsers";
import CategoryPage from "../components/pages/CategoryPageForAdmin";
import HomePage from "../components/pages/Homepage";
import LoginPage from "../components/pages/LoginPage";
import PostPage from "../components/pages/PostPage"
import RegisterPage from "../components/pages/RegisterPage";
import ResetPassword from "../components/pages/ResetPassword";
import TokenReset from "../components/pages/TokenConfirm";
import UserPage from "../components/pages/UserPage";
export const route = [
    { 
        path:'/', component:HomePage, exact:true
    },
    {
        path:'/post/:id', component:PostPage, exact: true
    },
    {
        path:'/register', component:RegisterPage,exact:true
    },
    {
        path:'/login', component:LoginPage,exact:true
    },
    {
        path:'/user/:id', component:UserPage,exact:true
    },
    {
        path:'/users', component: AllUsers, exact:true
    },
    {
        path:'/categories', component: CategoryPage, exact:true
    },
    {
        path:`/reset-password`, component: ResetPassword, exact:true
    },
    {
        path:`/reset-password/:token`, component: TokenReset, exact:true
    }
]
